"use strict";

const URL = require("../config/urls");

class VisionEntityResource {
  // POST /api/v1/vision/fingerprint
  postFingerprint(options, callback) {
    return this.apiClient._postRequest(
      URL.VISION_ENTITY_RESOURCE.FINGERPRINT,
      options,
      callback
    );
  }
}


  module.exports = VisionEntityResource;
  